// import components
import { Navlink2 } from "../../utils/links";

// import components
// utils
import PrivateRoute from "../../utils/PrivateRoute.js";

// import styles
import "./style.min.css";

const Dashboard = () => {
  const content = (
    <div className="private-content">
      <Navlink2 text="CREATE-BLOG" link="/newblog" />
      <Navlink2 text="CREATE-WORK" link="/newwork" />
      <Navlink2 text="UPDATE-PROFILE" link="/updateprofile" />
    </div>
  );

  return <PrivateRoute content={content} title="dashboard" />;
};

export default Dashboard;
